package isola.model.core;import java.util.Collection;import java.util.LinkedHashMap;import java.util.Map;import java.util.Set;import javax.servlet.jsp.tagext.BodyTagSupport;/** *  * @author Umut Gokbayrak */public class JsMap extends BodyTagSupport implements Map<String, Object> {	private static final long serialVersionUID = 4191854015114511308L;	private LinkedHashMap<String, Object> map = new LinkedHashMap<String, Object>();		public void clear() {		map.clear();	}		public boolean containsKey(Object key) {		return map.containsKey(key);	}		public boolean containsValue(Object value) {		return map.containsKey(value);	}		public Set<java.util.Map.Entry<String, Object>> entrySet() {		return map.entrySet();	}		public Object get(Object key) {		return map.get(key);	}		public boolean isEmpty() {		return map.isEmpty();	}		public Set<String> keySet() {		return map.keySet();	}		public Object put(String key, Object value) {		return map.put(key, value);	}		public void putAll(Map<? extends String, ? extends Object> m) {		map.putAll(m);	}		public Object remove(Object key) {		return map.remove(key);	}		public int size() {		return map.size();	}		public Collection<Object> values() {		return map.values();	}}